import React from 'react';
import './App.css';
import Pannier from './components/Pannier';
import Comand from './components/Comand';
export default function App() {
 
  return (
    <div>
        <div id='bnr' ><img src='logo.png' id='imglogo'/><span id='logo'>La maison jungle</span></div>
        <div id='banner' className='d-flex'>
          <Comand className='col-' />
          <Pannier className='col-8'/>
        </div>
     
    </div>
  )
}
